graphviz:
digraph {
  // Graph attributes
  label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"></table>>;
  labelloc="t";
  fontsize=10;
  fontname="Arial";
  compound=true;
  rankdir=TB;
  pad=0.25;
  node [fontname="Arial", fontsize=10];
  edge [fontname="Arial", fontsize=9];

  // Node definitions with nested namespaces
  "user" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left"><b>user</b></td></tr><tr><td><table border="0" cellborder="1" cellspacing="0" cellpadding="2" align="left"><tr><td port="email__key" align="left" balign="left">email : Email</td><td port="email__value" align="left" balign="left">user@example.com</td></tr><tr><td port="version__key" align="left" balign="left">version : SemVer</td><td port="version__value" align="left" balign="left">1.2.3</td></tr><tr><td port="port__key" align="left" balign="left">port : Port</td><td port="port__value" align="left" balign="left">8080</td></tr></table></td></tr></table>>, shape=folder, fillcolor="#E8F5E9", style=filled, color="#388E3C"];

}
